import './update.css'
import axios from 'axios';
import React from 'react';
import { Link} from 'react-router-dom';
import { useState, useEffect } from 'react';
import Card1 from './card1';
import Card2 from './card2';
import Card3 from './card3';
// import Updates from './Updates';



function Update(){

  const [users, setUsers] = useState([]);
    useEffect(() => {
        getUsers();
    }, []);

    function getUsers() {
        axios.get('https://database.resultpahle.com/users/').then(function(response) {
            console.log(response.data);
            setUsers(response.data);
        });
    }


    return(
        <div className='update'>
            <table>
                
            <div className='Top'>
            <tr>
            <span>Find The Right<br/> Result</span>
            </tr>
            </div>
            <tr>
            <div className='Mid'>
                <span className='Heading'>New Updates</span>
                {users.map((d, i) =>  (
            <tr key={i} className='data'>
              
              <td><li><Link to={`user/${d.id}`} style={{marginRight: "10px"}}>{d.email}</Link></li></td>
             
            </tr>
            
          ))}
        
            <Link to="user/list">View more</Link>

            </div>
            </tr>
            <tr>
            <td className='card1'>
            <Card1/>
            </td>
            <td className='card2'>
            <Card2/>
            </td>
            <td className='card3'>
            <Card3/>
            </td>
            </tr>
            </table>
        </div>
       
)}
export default Update
